package main

const MOD = 1000000007

// Solution 1
// Runtime: 12ms
// Memory Usage: 6.93MB
// Time Complexity: O(n)
// Space Complexity: O(n)
// Category: Stack
func countHomogenous(s string) (ans int) {
	stack := make([]rune, 0, len(s))

	for _, c := range s {
		if len(stack) == 0 {
			stack = append(stack, c)
			ans += 1
			ans %= MOD
			continue
		}

		n := len(stack)
		if stack[n-1] != c {
			stack = stack[n:]

		}
		stack = append(stack, c)
		ans += len(stack)
		ans %= MOD
	}

	return
}

// Solution 2
// Runtime: 12ms
// Memory Usage: 6.56MB
// Time Complexity: O(n)
// Category: Counter
func countHomogenous2(s string) (ans int) {
	curr := s[0]
	cnt := 1
	ans += cnt

	for i := 1; i < len(s); i++ {
		if s[i] == curr {
			cnt++
		} else {
			curr = s[i]
			cnt = 1
		}
		ans += cnt
		ans %= MOD
	}

	return
}

func main() {
	s := ""
	println(countHomogenous(s))
	println(countHomogenous2(s))
}
